import { React, Component } from "react";
import "./TodoOld.css";
import axios from "axios";
import { Table, Tag, Space, Button } from "antd";
import { EditTwoTone, DeleteTwoTone } from "@ant-design/icons";

class TodoNew extends Component {
  constructor() {
    super();

    this.state = { todoItems: [] };
  }

  componentDidMount() {
    axios
      .get("https://60b0f8b91f26610017fff943.mockapi.io/api/v1/todo_data")
      .then((res) => {
        this.setState({ todoItems: res.data });
      })
      .catch((err) => {
        console.log(err);
      });
  }

  render() {
    const columns = [
      {
        title: "id",
        dataIndex: "id",
        key: "id",
      },
      {
        title: "Title",
        dataIndex: "title",
        key: "title",
      },
      {
        title: "Is editing?",
        dataIndex: "isEditing",
        key: "isEditing",
        render: (isEditing) => {
          let color;
          if (isEditing === "false") {
            color = "volcano";
          }
          if (isEditing === "true") {
            color = "green";
          }
          return (
            <Tag color={color} key={isEditing}>
              {isEditing.toUpperCase()}
            </Tag>
          );
        },
      },
      {
        title: "Is complete?",
        dataIndex: "isComplete",
        key: "isComplete",
        render: (isComplete) => {
          let color;
          if (isComplete === "false") {
            color = "volcano";
          }
          if (isComplete === "true") {
            color = "green";
          }
          return (
            <Tag color={color} key={isComplete}>
              {isComplete.toUpperCase()}
            </Tag>
          );
        },
      },
      {
        title: "Action",
        key: "action",
        render: (text, record) => (
          <Space size="middle">
            <EditTwoTone />
            <DeleteTwoTone />
          </Space>
        ),
      },
    ];

    const { data } = this.state
    console.log(this.state);
    return (
      <div className="TodoNew">
        <Search
          placeholder="input search text"
          allowClear
          enterButton="Search"
          size="large"
          onSearch={onSearch}
        />
        <Button type="primary" size="large">
          +Add
        </Button>
        <Table columns={columns} dataSource={data} />
      </div>
    );
  }
}

export default TodoNew;
